    wigth: 80%;
    height: 80%;
`;

export const RowPage = styled.div`
    display: flex;
    justify-content: space-between;
    margin: 10px 15px;
`;

export const CartDetails = styled.div`
    display: block;
    border: 1px solid #457b9d;
    padding: 15px 15px;
    border-radius: 10px;    
`;

export const RowData = styled.div`
    display: block;
`;

